import { Route, Routes } from "react-router-dom";
import Home from "./routes/Home";
import Layout from "./components/Layout";

const App = () => {
  return (
    <>
      <Routes>
        <Layout>
          <Route exact path="/" element={<Home />} />
        </Layout>
      </Routes>
    </>
  );
};
export default App;
